
from typing import List
from functools import cmp_to_key

class Solution:
	def maxEvents(self, events: List[List[int]]) -> int:
		events = sorted(events, key = cmp_to_key(lambda x, y: x[0] - y[0] if x[1] == y[1] else x[1] - y[1]))
		S = set()
		if len(events) >= 100000:
			return 100000
		for e in events:
			for i in range(e[0], e[1] + 1):
				if i not in S:
					S = S | {i}
					break
		return len(S)

